window.onscroll = function() {
    // alert("scroll event detected! " + window.pageXOffset + " " + window.pageYOffset);
    if (window.pageYOffset > 100) {
        document.getElementById('header-menu').classList.add('header__top');
        document.getElementById('header-menu').classList.remove('header__box');
        //header__box-Top
        document.getElementById('header__box').classList.add('header__box-Top');
        document.getElementById('header__box').classList.remove('header__box');

    } else if (window.pageYOffset < 100) {
        document.getElementById('header-menu').classList.remove('header__top');
        //document.getElementById('header-menu').classList.remove('header__box');//header__box-Top
        document.getElementById('header__box').classList.remove('header__box-Top');
        document.getElementById('header__box').classList.add('header__box');
        $(".bx-component-opener").css("top", 170);
    }
}
